import React from "react";
import HighlightOffIcon from "@material-ui/icons/HighlightOff";

let ToDoList1 = (props) => {
  return (
    <>
      <div className = "addDiv">
      
        <HighlightOffIcon className="addBtn" />
        <li className="addList">{props.text}</li>
      </div>
    </>
  );
};

export default ToDoList1;
